# Translating RNA into Protein

rna = ""

lookup = {}
with open('../../Utils/codonTable', 'r') as file:
    lines = file.readlines()

    for line in lines:
        l = line.split()
        lookup[l[0]] = l[1]

proteins = ""

while len(rna) > 0:
    codon = rna[:3]
    if lookup[codon] == 'Stop':
        break
    proteins += lookup[codon]
    rna = rna[3:]

print(proteins)
